import React, { useState } from "react";
import { Card, Row, Col, Table } from "react-bootstrap";
import { Form, FormControl, Button } from "react-bootstrap";
import Sidebar from "../common/Sidebar.jsx";
import TopNavbar from "../common/Navbar.jsx";

const sampleItems = [
  { name: "Item1", containerName: "ContainerA", slot: 1, takenBy: "UserA" },
  { name: "Item2", containerName: "ContainerB", slot: 2, takenBy: "UserB" },
  { name: "Item3", containerName: "ContainerA", slot: 3, takenBy: "UserC" },
];

const AdminDashboard = () => {
  const [q, setQ] = useState("");
  const [result, setResult] = useState(null);

  const onSearch = (e) => {
    e.preventDefault();
    if (!q) return;
    const r = sampleItems.find(item => item.name.toLowerCase() === q.toLowerCase()) || null;
    setResult(r);
  };

  return (
    <div style={{ background: "#232536", minHeight: "100vh" }}>
      <Sidebar />
      <TopNavbar />
      <div style={{ marginLeft: 350, padding: "36px 30px 0 30px" }}>
        <h3 className="mb-4 text-white">Dashboard</h3>
        <Row className="g-3 mb-4">
          <Col md={3}>
            <Card className="p-3 text-center bg-dark border-0 shadow-sm">
              <h5 className="text-white-50">Total Containers</h5>
              <div className="display-6 text-white">19</div>
            </Card>
          </Col>
          <Col md={3}>
            <Card className="p-3 text-center bg-dark border-0 shadow-sm">
              <h5 className="text-white-50">Total Slots</h5>
              <div className="display-6 text-white">50</div>
            </Card>
          </Col>
          <Col md={3}>
            <Card className="p-3 text-center bg-dark border-0 shadow-sm">
              <h5 className="text-white-50">Occupied</h5>
              <div className="display-6 text-white">43</div>
            </Card>
          </Col>
          <Col md={3}>
            <Card className="p-3 text-center bg-dark border-0 shadow-sm">
              <h5 className="text-white-50">Pending Approvals</h5>
              <div className="display-6 text-white">2</div>
            </Card>
          </Col>
        </Row>
        <Form className="d-flex ms-auto me-3 mb-4" onSubmit={onSearch}>
          <FormControl
            placeholder="Search item name..."
            className="me-2 bg-dark text-white"
            value={q}
            onChange={(e) => setQ(e.target.value)}
            style={{ width: "200px", borderColor: "#5d6bed" }}
          />
          <Button type="submit" style={{ background: "#6d70fa", border: "none" }}>Search</Button>
        </Form>
        {result && (
          <div className="container-fluid px-3 py-2 search-result" style={{ marginLeft: 0 }}>
            <div className="alert alert-info p-2 mb-0">
              <strong>Found:</strong> {result.name} â€” {result.containerName} slot {result.slot} (taken by {result.takenBy})
            </div>
          </div>
        )}
        <h5 className="text-white-50">Recent Activity</h5>
        <Table bordered hover responsive className="table-dark mt-3">
          <thead>
            <tr>
              <th>Time</th>
              <th>Action</th>
              <th>Details</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td colSpan="3" className="text-center text-secondary">No history yet</td>
            </tr>
          </tbody>
        </Table>
      </div>
    </div>
  );
};

export default AdminDashboard;
